import React, { useState, useEffect } from 'react';
import './style.css'

const CarDesc = () => {
  const [brand, setBrand] = useState([]);
   useEffect(() => {

  fetch(
    `http://uimocks.infoedge.com/makes.json`,
    {
      method: "GET",    
    },    
  )
    .then(res => res.json())
    .then(response => {
       setBrand(response);
    })
    .catch(error => console.log(error));
});

	return (
		<React.Fragment>
        <select>        
        {brand.map((brand, index) => (
        <option
          key={index}
          value={index}
        >
          {brand}
        </option>
      ))}

    </select>
		</React.Fragment>
	)
}

export default CarDesc;
